import React from "react";
import eye_open from '../images/toggle-view.png'
import eye_shut from '../images/toggle-hide.png'


const ToggleView = ({view, toggleView }) => {
    if (view == false) {
        return(
            <input
            checked={view}
            onChange={toggleView}
            className="react-switch-checkbox"
            name="view"
            type="checkbox">
            <img className="navbar-logo" alt="view" src={eye_open} />
            </input>
        )
    }
    else {
    return (
     <input
        checked={view}
        onChange={toggleView}
        name="hide"
        className="react-switch-checkbox"
        type="checkbox">
        <img className="" alt="hide" src={eye_open} />
        </input>
    );
}
};

export default ToggleView
